  KEY `craft_commerce_orders_paymentSourceId_idx` (`paymentSourceId`),
  CONSTRAINT `craft_commerce_orders_customerId_fk` FOREIGN KEY (`customerId`) REFERENCES `craft_commerce_customers` (`id`) ON DELETE SET NULL,
  CONSTRAINT `craft_commerce_orders_gatewayId_fk` FOREIGN KEY (`gatewayId`) REFERENCES `craft_commerce_gateways` (`id`) ON DELETE SET NULL,
