utternut squash. These flavors are reminiscent of cool Autumn days. The homemade apple butter is spiced and sweet and the perfect pairing for the light flavor of the chicken and the sweetness of the squash. ',NULL,NULL,1,'2017-09-04 19:49:53','2018-03-28 18:13:47','4baf3566-e6fa-4c6f-8057-8fdeeda82cb5'),(106,106,1,'Large','[{\"col1\":\"Baked Chicken\",\"col2\":\"4 oz\",\"col6\":\"262\",\"col3\":\"52\",\"col4\":\"0\",\"col5\":\"6\",\"col7\":\"\"},{\"col1\":\"Apple Butter\",\"col2\":\"\",\"col6\":\"88\",\"col3\":\"1\",\"col4\":\"21\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"4oz\",\"col6\":\"67\",\"col3\":\"2.5\",\"col4\":\"9\",\"col5\":\"1\",\"col7\":\"\"},{\"col1\":\"Winter Squash\",\"col2\":\"5oz\",\"col6\":\"60\",\"col3\":\"1\",\"col4\":\"14\",\"col5\":\"0\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"463\",\"col1\":\"57\",\"col2\":\"43\",\"col3\":\"7\",\"col6\":\"49\",\"col7\":\"37\",\"col8\":\"14\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-04 19:49:53','2018-03-28 18:13:47','c29cf234-ad43-4fdf-8a5c-075a6195f2bf'),(113,113,1,'Roasted Chicken',NULL,'[{\"col5\":\"\",\"col4\":\"490\",\"col1\":\"58\",\"col2\":\"38\",\"col3\":\"12\"}]','With Broccoli','Remove plastic cup.  Microwave on high for 2 minutes or until heated through. ','2018-01-30 05:00:00','Contains egg and awesomeness.',NULL,'This everyday type of meal may not seem exciting. We think you’ll be surprised though. The roasting of the broccoli brings out subtle nutty hints to the vegetable which pairs perfectly with the roasted chicken. The potatoes are baked to perfection and come with homemade fresh salsa to give them a little spice. ',NULL,NULL,4,'2017-09-10 23:09:54','2018-03-28 18:13:47','4e47b9c6-7800-4f21-a702-632702346c12'),(114,114,1,'Large','[{\"col1\":\"Chicken\",\"col2\":\"6oz\",\"col6\":\"262\",\"col3\":\"52\",\"col4\":\"0\",\"col5\":\"6\",\"col7\":\"\"},{\"col1\":\"Marinade\",\"col2\":\"\",\"col6\":\"15\",\"col3\":\".5\",\"col4\":\"3\",\"col5\":\"0\",\"col7