r, spinach will be wilted. ','2018-02-02 05:00:00','Contains soy, and awesomeness. ',NULL,'It doesn’t have to be Tuesday to enjoy this delicious, completely vegan take on taco salad. The TVP taco mixture is tangy and spicy with tomatoes and jalapeños. The black beans are slow cooked overnight with a signature combination of spices. All of this is on top of fresh baby spinach that is meant to be heated together to make this a slightly wilted, warm salad. It is then topped with fresh homemade tomato salsa. ',NULL,NULL,1,'2017-09-18 23:18:25','2018-03-28 18:13:47','ed0212e4-43ba-4a67-8cfb-80158458f77e'),(128,128,1,'Large','[{\"col1\":\"Textured Vegetable Protein (TVP) Mixture\",\"col2\":\"2oz\",\"col6\":\"80\",\"col3\":\"12\",\"col4\":\"8\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Spinach\",\"col2\":\"\",\"col6\":\"8\",\"col3\":\"1\",\"col4\":\"1\",\"col5\":\"0\",\"col7\":\"\"},{\"col1\":\"Black Beans \",\"col2\":\"\",\"col6\":\"166\",\"col3\":\"10\",\"col4\":\"27\",\"col5\":\"2\",\"col7\":\"\"},{\"col1\":\"Fresh Salsa\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"377\",\"col1\":\"31\",\"col2\":\"54\",\"col3\":\"4\",\"col6\":\"33\",\"col7\":\"57\",\"col8\":\"10\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2017-09-18 23:18:25','2018-03-28 18:13:47','c68f08f1-e9a6-408b-80f6-2eb95cd4125c'),(129,129,1,'Medium ','[{\"col1\":\"Baked Chicken\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Apple Butter\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Green Beans\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Winter Squash\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"382\",\"col1\":\"44\",\"col2\":\"40\",\"col3\":\"5\",\"col6\":\"46\",\"col7\":\"42\",\"col8\":\"12\"}]',NULL,NULL,NULL