33'),(513,677,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-03-08 10:00:00',0,'2018-03-04 20:26:09','2018-03-08 15:30:18','f9b2f56b-f42e-41bb-b671-56d3677ab9c6'),(514,680,1,'Zucchini Frittata',NULL,NULL,'','Heat for 1 minute or until warm ',NULL,'',NULL,'Who doesn’t love a good frittata… Brunch anyone? Our delicious zucchini frittata is loaded with vegetables and protein. We take shredded zucchini, sweet cherry tomatoes and eggs, with some fat free feta and fresh basil, and make a delicious breakfast. Quinoa adds plant based protein and makes this dish hearty and filling, with a low calorie count. Our frittata is a great everyday type of meal, as the macros are very balanced. You can also eat it anytime of day, not just for breakfast.',NULL,NULL,1,'2018-03-05 11:53:59','2018-03-28 18:13:49','22a919af-20c6-4b00-9d7e-7bce33867ae0'),(515,681,1,'Frittata','[{\"col1\":\"\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"200\",\"col1\":\"13\",\"col2\":\"18\",\"col3\":\"8\",\"col6\":\"26\",\"col7\":\"36\",\"col8\":\"38\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-05 11:53:59','2018-03-28 18:13:49','0215ceb0-88f6-468f-b833-5dc66710a338'),(518,684,1,'FAQ',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-05 20:38:05','2018-03-05 20:38:05','9ff9ffab-de90-4b02-aa72-780675839dfa'),(519,685,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-03-20 09:00:00',0,'2018-03-06 03:08:09','2018-03-20 18:53:32','80fb225d-f892-408b-9a31-7fe7b452a1c3'),(520,687,1,'Vegan Cups',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-06 13:46:22','2018-03-06 15:28:45','b7546e3c-61c6-4e70-8aec-0ec16c73392b'),(530,697,1,'Vegan \'Egg\' Cups',NULL,NULL,'','Heat for 30 seconds or until warm',NULL,'',NULL,'These delicious little cups are a great light start to the day. They are packed with plant based proteins and veggies. These are a great vegan breakfast or even snack. Zucchini and fresh tomatoes pair perfectly with the flavors of basil and chickpeas. An easy on the go meal that has all the plant based protein you need.',NULL,NULL,3,'2018-03-06 15:31:08','2018-03-28 18:13:49','653d7f2f-c962-4765-a0b4-8729ea188187'),(531,698,1,'Vegan Cups','[{\"col1\":\"\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"155\",\"col1\":\"14\",\"col2\":\"11\",\"col3\":\"6\",\"col6\":\"36\",\"col7\":\"28\",\"col8\":\"35\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-06 15:31:08','2018-03-28 18:13:49','8b4d826d-02af-441e-acdb-44c63aa84aca'),(545,730,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-03-12 09:00:00',0,'2018-03-06 17:15:50','2018-03-12 14:09:16','2c6a7ff3-3d6f-4586-96a3-375b13f15f57'),(546,732,1,'Egg Buritto',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-07 01:25:49','2018-03-22 23:48:16','40ed6f31-f884-4c19-984a-1c4787aabf66'),(547,733,1,'Greek Salad',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-07 01:25:49','2018-03-07 01:25:49','9fed1633-31ab-4fba-9fc1-4570e6321343'),(548,734,1,'Turkey Buritto',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-07 01:25:49','2018-03-07 01:25:49','3e6f7c11-dee5-4b42-8d58-199c727158b7'),(549,738,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-03-12 09:00:00',0,'2018-03-07 17:10:36','2018-03-12 14:08:59','b01fa250-ce99-410b-a3ff-f15ee45b1b1d'),(550,740,1,'Abingdon',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-07 19:23:52','2018-03-07 19:23:52','e5da512c-5d7f-414a-b93c-7e4943077165'),(551,741,1,'Canton',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-07 19:23:59','2018-03-07 19:23:59','44544891-c8b3-4207-a538-01c9f2f4dafa'),(552,742,1,'Kelly',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-07 19:24:07','2018-03-07 19:24:07','e1028639-62f1-4a61-9ec2-8174976b2e62'),(553,743,1,'Greek Salad',NULL,NULL,'','Open and enjoy! Pour salad dressing on and shake to mix. ',NULL,'Contains awesomeness.',NULL,'In Greece, the Greek Salad is referred to as a salted herb salad.  We wanted to bring the combination of flavors that we love (salty olives, sweet tomatoes, and tangy balsamic vinaigrette) to the Macro Meals menu in a healthy and well balanced way.  It took lots of trial and error but we are excited to be adding three variations of Greek salad to the menu!  A vegan version that comes without the feta cheese, a vegetarian version that includes the feta cheese, and a protein version with chicken. The vegan version is filling and only 186 calories.  It is lower in protein for the macro density, but it’s a great salad for anyone trying to cut the calories and taking a rest day from the gym. The protein version is 500 calories but it comes with a whopping 57g of protein!',NULL,NULL,1,'2018-03-08 00:41:39','2018-03-28 18:13:49','a854b1bb-76c6-4462-bec5-452f7635eb1c'),(554,744,1,'Vegan','[{\"col1\":\"Greek Salad-Cucumber, Spinach, Tomato, Olives kalamata \",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Balsamic Vinaigrette \",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"111\",\"col1\":\"2\",\"col2\":\"12\",\"col3\":\"7\",\"col6\":\"7\",\"col7\":\"43\",\"col8\":\"50\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-08 00:41:39','2018-03-28 18:13:49','5a754c63-501e-4aef-bccc-8e789dac4f20'),(555,745,1,'With Cheese ','[{\"col1\":\"Greek Salad-Cucumber, Spinach, Tomato, Olives kalamata \",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Balsamic Vinaigrette \",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Fat Free Feta\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"\",\"col4\":\"147\",\"col1\":\"5\",\"col2\":\"18\",\"col3\":\"7\",\"col6\":\"14\",\"col7\":\