h for 30 seconds to 1 minute (or devour cold as we like to do from time to time when microwaves take too long)',NULL,'Contains nuts',NULL,'Brussels sprouts are one of our favorite snacks. These delicious little veggies are fiber rich and contain many vitamins; including some  B vitamins, vitamin C and vitamin K. Vitamin K plays a crucial role in blood flow and bone health. Aside from their health benefit, Brussels sprouts are delicious and filling. They make a great quick snack. These sprouts are roasted to give a slightly nutty flavor and paired with smoky almonds. This flavor pairing is not only healthy but delicious enough to have you craving more. These are good for anytime of day, or fitness goal, so get to snacking!',NULL,NULL,0,'2018-03-23 14:55:56','2018-03-29 16:54:57','14894230-5c5b-47af-9939-7acdeefabe4a'),(613,835,1,'Roasted Brussels Sprouts','[{\"col1\":\"Roasted Brussels Sprouts\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"},{\"col1\":\"Smoked Almonds\",\"col2\":\"\",\"col6\":\"\",\"col3\":\"\",\"col4\":\"\",\"col5\":\"\",\"col7\":\"\"}]','[{\"col5\":\"5 oz\",\"col4\":\"205\",\"col1\":\"8\",\"col2\":\"12\",\"col3\":\"14\",\"col6\":\"16\",\"col7\":\"23\",\"col8\":\"61\"}]',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-23 14:55:56','2018-03-29 16:54:57','416b36d6-9b65-466b-9cd0-f525cf9cdf74'),(614,836,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-03-26 09:00:00',0,'2018-03-23 15:22:32','2018-03-23 15:47:17','d77083b8-8635-4ff5-9ad2-81e6b379596a'),(615,844,1,'Meals',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-25 18:56:38','2018-03-25 18:56:38','3876ee23-df29-40aa-9c56-43dbd61939af'),(616,845,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,'2018-03-25 18:57:59','2018-03-28 14:55:13','ce792474-f218-4d6c-a20d-3b9a307d81cd'),(619,848,1,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2018-04-02 05:00:00',0,'2018-03-29 20:40:31','2018-03-31 16:59:59','83d71054-b7f9-488f-890c